import React from 'react';
import { Button, Card, CardHeader, CardContent, CardFooter, CardTitle, CardDescription } from './YourCustomComponents'; // Import custom components

// JobRecommendations component
const JobRecommendations = () => {
  const jobs = ["Software Developer", "Data Analyst", "UX Designer"];

  return (
  <>
    <h2 className="text-2xl font-bold mb-4">Job Role Recommendations</h2>
    <div className="space-y-4">
      {['Software Developer', 'Data Analyst', 'UX Designer'].map((job, index) => (
        <div key={index} className="border border-gray-300 rounded p-4 shadow-sm">
          <h3 className="text-lg font-semibold">{job}</h3>
          <p className="text-sm text-gray-600">User needs by employing diagrams and models, writing code, and ensuring overall functionality.</p>
          <button className="mt-2 px-4 py-2 bg-blue-500 text-white rounded">Learn More</button>
        </div>
      ))}
    </div></>
  );
};

export default JobRecommendations;
